    VStack(spacing: VOMetrics.spacing) {
        VOAvatar(name: "Bruce Wayne", size: 100)
        VOAvatar(name: "你好世界!!!", size: 100)
        VOAvatar(name: "مرحبا بالجميع", size: 100)
        VOAvatar(name: "Cat", size: 100, base64Image: Constants.base64Image)
    }
}

enum Constants {
    // swiftlint:disable:next line_length
    static let base64Image = "data:image/jpeg;base64,"
}
